data\":{\"contentType\":\"Texte\",\"license\":\"U\",\"title\":\"Rappels et consignes\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Rappels et consignes\"}},\"alwaysDisplayComments\":true,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":17.426805251641138,\"y\":4.285917926565875,\"width\":34.79212253829321,\"height\":10.799136069114471,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"color:#ffffff\\\"><span style=\\\"font-size:1.75em\\\">Rappels et consignes</span></span></p>\\n\"},\"subContentId\":\"56e776b3-73cb-4e42-a116-499a3992deef\",\"metadata\":{\"contentType\":\"Texte\",\"license\":\"U\",\"title\":\"Titre\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Titre\"}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"keywords\":[{\"main\":\"Rappels\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":1.0893246187363834,\"y\":23.605591397849462,\"width\":98.03921568627452,\"height\":70.96774193548387,\"action\":{\"library\":\"H5P.Dialogcards 1.8\",\"params\":{\"mode\":\"normal\",\"description\":\"\",\"dialogs\":[{\"tips\":{},\"text\":\"<p>Lister la différence d'espace disque des filesystem ext4 entre maintenant et il y a 10h.</p>\\n\\n<p> </p>\\n\\n<p>Indice : <em>node_filesystem_free_bytes</em></p>\\n\",\"answer\":\"<p>node_filesystem_free_bytes{fstype=\\\"ext4\\\"} - node_filesystem_free_bytes{fstype=\\\"ext4\\\"} offset 10h</p>\\n\"},{\"tips\":{},\"text\":\"<p>Lister les cibles qui ont exposé plus de 100 séries.</p>\\n\\n<p> </p>\\n\\n<p>Indice : <em>scrape_samples_scraped</em></p>\\n\",\"answer\":\"<p>scrape_samples_scraped &gt; 100</p>\\n\"},{\"tips\":{},\"text\":\"<p>Afficher le nombre de bytes transmis et reçus par interface réseau.</p>\\n\\n<p> </p>\\n\\n<p>Indice: <em>\\\"node_network_.*b.*total\\\"</em></p>\\n\",\"answer\":\"<p>{__name__=~\\\"node_network_.*b.*total\\\"}</p>\\n\"},{\"tips\":{},\"text\":\"<p>Afficher le nombre total de métriques par job.</p>\\n\\n<p> </p>\\n\\n<p>Indice : <em>scrape_samples_scraped</em></p>\\n\",\"answer\":\"<p>sum by(job) (scrape_samples_scraped)</p>\\n\"},{\"tips\":{},\"text\":\"<p>Indiquer le nombre total de requêtes, pour les status qui ne sont pas de la famille 4xx, pour les méthodes qui commencent par un P et finissent par un T.</p>\\n\\n<p> </p>\\n\\n<p>Indice : <em>flask_http_request_total</em></p>\\n\",\"answer\":\"<p>sum (flask_http_request_total{status!~\\\"^4..$\\\", method=~\\\"^P.*T$\\\"})</p>\\n\"},{\"tips\":{},\"text\":\"<p>Indiquer pour quelles méthodes et status le nombre de requêtes d'API arrivées sur les deux dernières heures est supérieur à ce même nombre il y a 12h.</p>\\n\\n<p> </p>\\n\\n<p>Indice : <em>flask_http_request_total</em></p>\\n\",\"answer\":\"<p>(flask_http_request_total - flask_http_request_total offset 2h) &gt; (flask_http_request_total offset 12h - flask_http_request_total offset 14h)</p>\\n\"},{\"tips\":{},\"text\":\"<p>Combien y a-t'il de core sur chaque instance ?</p>\\n\\n<p> </p>\\n\\n<p>Indice : <em>node_cpu_guest_seconds_total</em></p>\\n\",\"answer\":\"<p>count by(instance) (node_cpu_guest_seconds_total{mode=\\\"nice\\\"})</p>\\n\"},{\"tips\":{},\"answer\":\"<p>sort_desc(topk (10, count by(__name__) ({__name__=~\\\".+\\\"})))</p>\\n\",\"text\":\"<p>Afficher dans l'ordre descendant les noms des 10 métriques ayant la plus grande cardinalité.</p>\\n\"},{\"tips\":{},\"text\":\"<p>Quel est le pourcentage de requêtes ayant un status 200 pour chaque méthode existante ?</p>\\n\\n<p> </p>\\n\\n<p>Indice : <em>flask_http_request_duration_seconds_bucket</em></p>\\n\",\"answer\":\"<p>flask_http_request_duration_seconds_bucket{le=\\\"+Inf\\\", status=\\\"200\\\"} * 100 / on (method) sum by(method) (flask_http_request_duration_seconds_bucket{le=\\\"+Inf\\\"})</p>\\n\"},{\"tips\":{},\"text\":\"<p>Afficher le pourcentage d'occupation d'espace disque le plus élevé pour les devices dont le nom contient \\\"vda\\\".</p>\\n\\n<p> </p>\\n\\n<p>Indice : <em>\\\"n..._.*m_.+_.+\\\"</em></p>\\n\",\"answer\":\"<p>topk (1, (node_filesystem_size_bytes{device=~\\\".*vda.*\\\"} - node_filesystem_avail_bytes{device=~\\\".*vda.*\\\"}) * 100 / node_filesystem_size_bytes{device=~\\\".*vda.*\\\"})</p>\\n\"}],\"behaviour\":{\"enableRetry\":true,\"disableBackwardsNavigation\":false,\"scaleTextNotCard\":true,\"randomCards\":false,\"maxProficiency\":5,\"quickProgression\":false},\"answer\":\"Retourner\",\"next\":\"Suivant\",\"prev\":\"Précédent\",\"retry\":\"Recommencer\",\"correctAnswer\":\"J'ai eu bon!\",\"incorrectAnswer\":\"J'ai eu faux\",\"round\":\"Round @round\",\"cardsLeft\":\"Cartes restantes: @number\",\"nextRound\":\"Procéder au round @round\",\"startOver\":\"Recommencer\",\"showSummary\":\"Suivant\",\"summary\":\"Résumé\",\"summaryCardsRight\":\"Cartes correctes:\",\"summaryCardsWrong\":\"Cartes incorrectes:\",\"summaryCardsNotShown\":\"Cartes non montrées:\",\"summaryOverallScore\":\"Score global\",\"summaryCardsCompleted\":\"Cartes que vous avez complétées:\",\"summaryCompletedRounds\":\"Rounds complétés:\",\"summaryAllDone\":\"Bien joué! Vous avez réussi à avoir les @cards cartes correctes @max fois de suite!\",\"progressText\":\"Carte @card sur @total\",\"cardFrontLabel\":\"Le devant de la carte\",\"cardBackLabel\":\"Le dos de la carte\",\"tipButtonLabel\":\"Montrer l'indice\",\"audioNotSupported\":\"Votre navigateur ne supporte pas ce fichier audio\",\"confirmStartingOver\":{\"header\":\"Recommencer?\",\"body\":\"Toutes les progressions seront perdues. Êtes-vous sûr de vouloir recommencer?\",\"cancelLabel\":\"Annuler\",\"confirmLabel\":\"Recommencer\"},\"title\":\"\"},\"subContentId\":\"6548d0ad-6735-4b08-9f60-0245a2193147\",\"metadata\":{\"contentType\":\"Cartes de dialogue (Dialog Cards)\",\"license\":\"U\",\"title\":\"Requêtes PromQL\",\"auth
